let getToken = () => "pco";
exports.encryption = (password) => {
	let arr = [...password];
	let arr2 = [...getToken()];
	let arr3 = [];
	for(let i = 0; i < arr2.length; i++) {
		arr[i] += arr2[i];
	}
	for(let j = 0; j < arr.length; j++) {
		arr[0] += arr[j];
	}
	arr3.push(arr[0].subString(1, arr[0].length));
	console.log(arr3);
	let encryption_pw = getToken() + parseInt(password) + 1110;
	return encryption_pw;
}